impl Solution {
    pub fn missing_integer(nums: Vec<i32>) -> i32 {
        let mut nums = nums;
        nums.sort_unstable(); // Sort the vector to easily find sequences
        let mut longest_seq_sum = 0;
        let mut current_seq_start = nums[0];
        let mut current_seq_length = 1;
        let mut max_seq_length = 1;

        for i in 1..nums.len() {
            if nums[i] == nums[i - 1] + 1 {
                // Continues the sequence
                current_seq_length += 1;
            } else if nums[i] > nums[i - 1] + 1 {
                // Breaks the sequence, check if it's the longest
                if current_seq_length > max_seq_length {
                    max_seq_length = current_seq_length;
                    longest_seq_sum = current_seq_start * current_seq_length + current_seq_length * (current_seq_length - 1) / 2;
                }
                // Reset for a new sequence
                current_seq_start = nums[i];
                current_seq_length = 1;
            }
            // Last sequence check
            if current_seq_length > max_seq_length {
                longest_seq_sum = current_seq_start * current_seq_length + current_seq_length * (current_seq_length - 1) / 2;
            }
        }

        // Find the smallest missing integer
        let mut x = longest_seq_sum + 1;
        while nums.contains(&x) {
            x += 1;
        }
        x
    }
}
